import React, { useEffect, useState } from "react";
import axios from "axios"

function SearchBar(){

    const[search, setSearch] = useState("");
    const [data, setData] = useState([]);

    useEffect(()=>{
        const fetchUsers = async () =>{
            const res = await axios.get(`http://localhost:8800?q=$`)
            setData(res.data)
        }
        fetchUsers();
    },[])
    return(
        <div>
            <input placeholder="Search for College" onChange={(e) => setSearch(e.target.value)} />

            {data.map(function(item){
                return(
                    <h2>{item}</h2>
                )
            })}
        </div>
    )
}

export default SearchBar
